import React, { Component } from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import ResidentName from '../ResidentName';
import DateOfBirth from '../ResidentDOB';
import ResidentRoom from '../ResidentRoom';
import Header from '../../../Header';

const ResidentName1 = ResidentName;
const DateOfBirth1 = DateOfBirth;

class CarePlan1 extends Component {
  render() {
    return (

        <div>
            <Header/>
            <Container>
              <Row>
                    <Col md="auto">
                    <div>
                      <ResidentName/>
                    </div>
                    </Col>
                </Row>
                <Row>
                    <Col md="auto">                    
                    <div>
                      <DateOfBirth/>
                    </div>
                    </Col>
                    <Col sm={8}>
                    <div>
                      <ResidentRoom/>
                    </div>
                      </Col>
                      <Col/>
                      <Col/>
                      <Col/>
                </Row>
                </Container>
          </div>


    );
  }
}

export default CarePlan1;
